INSERT INTO `v1_8f8f6e3ecf8c9337c0e089dd905abc93eed313d625a874023d87b7827cf02a30` VALUES (1, 5, 11, "ふふ。ボクを呼んでくれて正解だよ。\nこの新年の晴れやかな日にこそ\nボクの輝く美貌が必要だからね！", 513, 0, 0.5, 0, 0, 100811, 513043);
